def get_sg(input):
	#see if it's an integer or a string
	try:
		sgnum = numpy.int(input)
		int = True
	except:
		int = False
	#start an array for matching space groups (I don't think there will ever be more than two, but keeping it general can't be bad, right?)
	spacegroups = []
	if int:
		for group in sg:
			if group['number'] == sgnum:
				spacegroups.append(group)
	else:
		for group in sg:
			if group['name'] == input:
				spacegroups.append(group)
	if spacegroups == []:
		return False
	else:
		return spacegroups

def get_generators(sgnum, setting):
	if sgnum < 1 or sgnum > 230:
		#passed an invalid space group number
		return False
	spacegroups=[]
	for group in sg:
		if group['number'] == sgnum:
			spacegroups.append(group)
	if len(spacegroups) > 1:
		for group in spacegroups:
			if group['setting'] == setting:
				return group['transform'], group['translate']
		#this is if a setting is required, but didn't match
		return False
	else:
		return spacegroups[0]['transform'],spacegroups[0]['translate']

def trans(r,transform,translate):
	R = numpy.dot(transform,r)
	R += translate
	#keep it in the unit cell
	R = numpy.remainder(R,1)
	return R

# gen_unit_cell
# --------------------------
# This function tranforms input coordinates r_in with the appropriate stuff for space group sg
# It will also transform a general array of attr_in, which might contain atom names, magnetic moments etc
# If attr_in is set to False, this will not be done and no attr_out will be returned
def gen_unit_cell(sg,r_in,attr_in):
	sgnum = sg['number']
	setting = sg['setting']
	transform, translate = get_generators(sgnum, setting)
	#initialise output variables
	r_gen = numpy.zeros((len(r_in)*len(transform),3),numpy.float)
	if attr_in != False:
		attr_gen = []
	#perform every transformation on every vector
	for i in range(len(r_in)):
		for j in range(len(transform)):
			r_gen[len(transform)*i+j] = trans(r_in[i],transform[j],translate[j])
			if attr_in != False:
				attr_gen.append(attr_in[i])
	#throw away the duplicates
	r_out =[]
	if attr_in != False:
		attr_out = []
	for i in range(len(r_gen)):
		#only check the subsequent values to discard, such that the first of each is kept
		keep = True
		for j in range(len(r_gen)-i-1):
			#if it's damn close - 999 how damn close? (can't just use equality because of rounding errors)
			if numpy.all(numpy.less(r_gen[i],r_gen[i+j+1] + 0.001)) and  numpy.all(numpy.greater(r_gen[i],r_gen[i+j+1] - 0.001)):
				keep = False
		if keep:
			r_out.append(r_gen[i])
			if attr_in != False:
				attr_out.append(attr_gen[i])
	r_out = difn.zero_if_close(r_out)
	if attr_in != False:
		return r_out, attr_out
	else:
		return r_out
